import React from "react";
import "./CircleIcon.css";

const CircleIcon = () => {
  return (
    <svg
      aria-hidden="true"
      className="icon icon-circle-o"
      xmlns="http://www.w3.org/2000/svg"
    >
      <use xlinkHref="#icon-circle-o"></use>
    </svg>
  );
};

export default CircleIcon;
